import React from "react";

function Card(props){
    return (<div>
        <h2>{props.name}</h2>
        {/* <img src={props.img} alt="avatar"/> */}
        <p>{props.tel}</p>
        <p>{props.email}</p>
    </div>);
}

function App(){
    <Card name="test" tel="1234" email="ee@d.com"/>
}

export default App;
